import { Component } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import AboutMePage from "../pages/AboutMePage";
import ContactPage from "../pages/ContactPage";
import WelcomePage from "../pages/WelcomePage";
import PostsListPage from "./PostsListPage";
import LeftPanel from "./LeftPanel";
import NoPage from "./NoPage";

import { Wrapper, Title } from "./components/AppStyles";
import "./App.css";

type AppState = {};

class App extends Component<{}, AppState> {
    render() {
        return (
            <>
                <header>
                    <Title>Blog Beaty</Title>
                </header>
                <Wrapper>
                    <BrowserRouter>
                        <Routes>
                            <Route path="/" element={<LeftPanel />}>
                                <Route
                                    path="/Welcome"
                                    element={
                                        <WelcomePage isActive={isActive} />
                                    }
                                />
                                <Route
                                    path="/AboutMe"
                                    element={
                                        <AboutMePage isActive={isActive} />
                                    }
                                />
                                <Route
                                    path="/Blog"
                                    element={<PostsListPage />}
                                />
                                <Route
                                    path="/Contact"
                                    element={
                                        <ContactPage isActive={isActive} />
                                    }
                                />
                                <Route
                                    path="*"
                                    element={<NoPage isActive={isActive} />}
                                />
                            </Route>
                        </Routes>
                    </BrowserRouter>
                </Wrapper>
            </>
        );
    }
}
export default App;
